{"cells":[{"cell_type":"markdown","metadata":{"id":"tkOnWLdH8YnT"},"source":["# ***An Empirical Investigation into the Determinants of Sleep Quality***"]},{"cell_type":"markdown","source":["The present work aims to determine the most important factors that affect people sleeping quality. This goal was pursued through the construction of a survey, which has taken into consideration manifold possible causes like food nutrition, anxiety and stress levels, physical activities, drinking habits and screen time.\n","\n","\n","The survey questionnaire was meticulously crafted to elicit crucial information regarding sleep patterns, daily routines, lifestyle choices, and mental health. Respondents were asked about their screen time, dietary behaviours, physical activity levels, mental health indicators, and various demographic characteristics. By collecting data via this survey, we were able to gain valuable insights into the determinants of sleep quality and deprivation among the sample population."],"metadata":{"id":"GjNLR8pXvxGc"}},{"cell_type":"markdown","metadata":{"id":"A_6pseHT5tx7"},"source":["# **Sharable Links**\n","* [socio-demo data](https://drive.google.com/file/d/12OKratxrfC2v6xFrjvEvM82CwRn2iAkv/view?usp=drive_link)\n","* [Sleep-Quality data](https://docs.google.com/spreadsheets/d/1keCd7ZCmSYAf3O07XgBhaEW3dSc3Gpg-/edit?usp=drive_link)\n","* [Screen Time data](https://docs.google.com/spreadsheets/d/1zcoiW5WJrGSTi3bue8XfXQI9IE9vPRpQ/edit?usp=drive_link)\n","* [Physical Activities](https://docs.google.com/spreadsheets/d/1HKFLlRZ-BQbzJ8u4UWqUuhcq24LWIxvo/edit?usp=drive_link)\n","* [Nutritions](https://docs.google.com/spreadsheets/d/1B-Yg93Ft1Mmze6qUHcF5S9Fx4CuIIT19/edit?usp=drive_link)\n"]},{"cell_type":"markdown","metadata":{"id":"xKbBlJAZNUus"},"source":["## ***Packages installation and import***"]},{"cell_type":"code","execution_count":null,"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"-r51ienQNYsi","outputId":"d36f9b4b-93f0-4c54-c13a-dce7c382