phone_activities**: answers the question 'What are the main activities you use your smartphone for? (More than one option can be chosen)'\n","- **smartphone_usage_before_sleep**: answers the question'Before going to sleep, when do you stop using your smartphone?'\n","- **smartphone_blue_light_filter**: answers the question'Do you use the blue light filter on your smartphone?\\n(Many smartphones have a ‘Night Shift’ or ‘Night Mode’ feature that reduces blue light emission at night by changing the screen’s color temperature to a warmer hue, which can be found in the display settings and set to turn on automatically.)'\n","- **tv_hours**\n","- **tv_programs**: answers the question 'Which programmes do you tend to watch mostly? (More than one option can be chosen)'\n","- **tv_usage_before_sleep**: answers the question'Before going to sleep, when do you stop watching television?'\n","- **Screen_time_score**\n","- **go_to_sleep_time**: asnwers the question 'At what time do you usually go to bed?',\n","- **wake_up_time**: answers the question 'At what time do you usually wake up?',\n","- **dummy_nap**: answers the question 'Do you usually take a nap in the afternoon?',\n","- **nap_duration**: answers the question 'How long does your afternoon nap usually last?',\n","- **dummy_medicine_help_sleep**: answers the question 'Do you take any medicines to help you sleep?',\n","- **dummy_medicines_affect_sleep**: answers the question 'Do you take any medicines that may affect your sleep quality?'\n","- **Sleep_score**\n","- **BMI**: Body Mass Index,\n","- **birth_year**: year of birth,\n","- **birth_country**: country of birth,\n","- **current_employment**: current employement,\n","- **studies_type**: what kind of studies the user is pursuing\n"]},{"cell_type":"code","execution_count":null,"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"wgOMITfDdC-M","outputId":"f5d1ff98-2a6a-481c-a5e6-2e313e8760f1","executionInfo":{"status":"ok","timestamp":1687529544439,"user_tz