ities = 'What are the main activities you use your smartphone for? (More than one option can be chosen)',\n","    smartphone_usage_before_sleep = 'Before going to sleep, when do you stop using your smartphone?',\n","    smartphone_blue_light_filter = 'Do you use the blue light filter on your smartphone?\\n(Many smartphones have a ‘Night Shift’ or ‘Night Mode’ feature that reduces blue light emission at night by changing the screen’s color temperature to a warmer hue, which can be found in the display settings and set to turn on automatically.)',\n","    tv_programs = 'Which programmes do you tend to watch mostly? (More than one option can be chosen)',\n","    tv_usage_before_sleep = 'Before going to sleep, when do you stop watching television?',\n","    go_to_sleep_time = 'At what time do you usually go to bed?',\n","    wake_up_time = 'At what time do you usually wake up?',\n","    dummy_nap = 'Dummy Nap',\n","    nap_duration = 'How long does your afternoon nap usually last?',\n","    dummy_medicine_help_sleep = 'Dummy medicines help sleeping',\n","    dummy_medicines_affect_sleep = 'Dummy medicines affect sleeping',\n","    weight_kg = 'What.is.your.weight..kg',\n","    height_cm = 'What.is.your.height..cm',\n","    birth_year = 'Year.of.birth',\n","    birth_country = 'Country.of.birth',\n","    current_employment = 'Current.employment',\n","    studies_type = 'What.kind.of.studies.are.you.currently.pursuing.'\n","  )\n","\n","\n","# Clean NA's from the data\n","all_data <- all_data %>%\n","  filter(!is.na(Stress_score) &\n","         !is.na(Anxiety_score) &\n","         !is.na(Sleep_score))\n","\n","all_data$BMI <- all_data$weight_kg / ((all_data$height_cm / 100) ^ 2)\n","\n","# Remove 'weight_kg' and 'height_cm' columns\n","all_data <- subset(all_data, select = -c(weight_kg, height_cm))\n","\n","\n","sleep_scores <-  all_data %>% select('user_id', 'Sleep_score')\n","\n","\n","\n","\n","# Modify variables that need so. For example,\n","# For laptop_activities a