aset\n","for (variable in names(all_data)) {\n","  # Exclude the \"laptop_activities\", \"smartphone_activities\", \"tv_programs\", and \"Sleep_score\" variables because these varables are not compatible with the ANOVA analysis\n","  if (variable != \"laptop_activities\" && variable != \"smartphone_activities\" && variable != \"tv_programs\" && variable != \"Sleep_score\") {\n","    # Create the formula for ANOVA\n","    formula <- as.formula(paste(\"Sleep_score ~\", variable))\n","\n","    # Fit the ANOVA model\n","    model <- aov(formula, data = all_data)\n","\n","    # Store the ANOVA model in the list\n","    anova_models[[variable]] <- model\n","  }\n","}\n","\n","# Print the ANOVA table for each variable\n","for (variable in names(anova_models)) {\n","  cat(\"Variable:\", variable, \"\\n\")\n","  cat(\"--------------------------\\n\")\n","  summary_anova <- summary(anova_models[[variable]])\n","  print(summary_anova, digits = 4)\n","  cat(\"\\n\")\n","}\n"],"metadata":{"id":"OxiPMV7idEWy","colab":{"base_uri":"https://localhost:8080/"},"executionInfo":{"status":"ok","timestamp":1687511355559,"user_tz":-120,"elapsed":214,"user":{"displayName":"Huma Rehman","userId":"00507676588822482715"}},"outputId":"1a08a0b3-d351-4eae-87b5-67b3700c4a6f"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stdout","text":["Variable: user_id \n","--------------------------\n","             Df Sum Sq Mean Sq F value Pr(>F)\n","user_id       1      0   0.006   0.001  0.977\n","Residuals   180   1325   7.363               \n","\n","Variable: Drinking_score \n","--------------------------\n","                Df Sum Sq Mean Sq F value Pr(>F)  \n","Drinking_score   1     24  24.028   3.307 0.0707 .\n","Residuals      174   1264   7.265                 \n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n","6 observations deleted due to missingness\n","\n","Variable: Food_score \n","--------------------------\n","             Df Sum Sq Mean Sq F v