age_before_sleep %in% c(\"45 minutes before\", \"30 minutes before\"), \"high\",\n","                                              \"extreme\"))\n","\n","df$smartphone_usage_before_sleep <- ifelse(df$smartphone_usage_before_sleep == \"15 minutes before\", \"low\",\n","                                           ifelse(df$smartphone_usage_before_sleep %in% c(\"45 minutes before\", \"30 minutes before\"), \"high\",\n","                                                  \"extreme\"))\n","\n","# Create the contingency table\n","contingency_table <- table(df$laptop_usage_before_sleep, df$smartphone_usage_before_sleep)\n","\n","# Perform the chi-square test\n","result <- chisq.test(contingency_table)\n","\n","# Print the results\n","print(result)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"id":"1ec4AZJbOye6","executionInfo":{"status":"ok","timestamp":1687509452232,"user_tz":-120,"elapsed":335,"user":{"displayName":"Huma Rehman","userId":"00507676588822482715"}},"outputId":"cace8614-6803-402d-b3c9-f1b15339d723"},"execution_count":null,"outputs":[{"output_type":"stream","name":"stderr","text":["Warning message in chisq.test(contingency_table):\n","“Chi-squared approximation may be incorrect”\n"]},{"output_type":"stream","name":"stdout","text":["\n","\tPearson's Chi-squared test\n","\n","data:  contingency_table\n","X-squared = 9.8712, df = 4, p-value = 0.04265\n","\n"]}]},{"cell_type":"markdown","source":["Conversion of all the scores to categorical values"],"metadata":{"id":"4HX0cbQaM73b"}},{"cell_type":"code","source":["# Subset the qualitative_dataset dataframe using the specified row names\n","df <- all_data\n","df <- df[complete.cases(df$laptop_usage_before_sleep), ]\n","df <- df[complete.cases(df$smartphone_usage_before_sleep), ]\n","\n","category_labels <- c(\"Low\", \"Medium\", \"High\")\n","\n","# Categorize the numerical values into ranges for all the scores\n","range_intervals <- c(5,20,35, 50)\n","Stress_score <- cut(df$Stress_score, breaks = ran